import React, { useState } from 'react';


const Navbar = () => {
  const [activeMenu, setActiveMenu] = useState(null);

  const toggleMenu = (menu) => {
    setActiveMenu(activeMenu === menu ? null : menu);
  };

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src="logo.png" alt="Logo" />
      </div>
      <div className="navbar-menu">
        {['Product', 'About', 'Resources', 'Pricing'].map((item, index) => (
          <div key={index} className="navbar-item">
            <a href={`#${item.toLowerCase()}`} onClick={() => toggleMenu(item)}>
              {item} <span className="arrow">{activeMenu === item ? '▲' : '▼'}</span>
            </a>
            {activeMenu === item && (
              <div className="submenu">
                <div className="submenu-content">
                  <p>Submenu content for {item}</p>
                  {/* Add more submenu content here */}
                </div>
              </div>
            )}
          </div>
        ))}
      </div>
      <div className="navbar-buttons">
        <button className="btn-login">Login</button>
        <button className="btn-sales">Talk to Sales</button>
        <button className="btn-get-started">Get Started Free</button>
      </div>
      <div className="navbar-toggle" onClick={() => toggleMenu('mobile')}>
        <span className="toggle-bar"></span>
        <span className="toggle-bar"></span>
        <span className="toggle-bar"></span>
      </div>
    </nav>
  );
};

export default Navbar;
